class Projectcomp extends React.Component{
    state = {
        project: [
            {
                id:"1",
                title:"skdlf",
                url:""
            },
            {
                id:"2",
                title:"test",
                url:""
            }
        ]
    }
    render(){
        return(
        <div>
            {this.props.passval}
            {this.props.passvalue}
            </div>
        )
    }
}

export default Projectcomp;
